import React from 'react'
import '../css/Modal.css'
import { useEffect } from 'react'
import exchangeIt from '../assets/exchange-it.PNG'
import repos from '../assets/repos.PNG'
import shootingStars from '../assets/shoot-for-the-stars.PNG'

const Modal = ({modalNumber}) => {

    console.log(modalNumber)

    let imgSource = {}
    let infoSource = ''

    useEffect(() => {
        if (modalNumber == 1) {
            imgSource = exchangeIt
        } else if (modalNumber == 2) {
            imgSource = repos
        } else if (modalNumber == 3) {
            imgSource = shootingStars
        }
    },[])


  return (
    <div className='modal-background'>
        <div className='modal'>
            <img src={imgSource} />
            <p></p>
        </div>
    </div>
  )
}

export default Modal
